Template.adminDashboard.helpers({
	users: function() {
		return Meteor.users.find({},{sort:{"profile.role": 1}});
	},
	userRole: function() {
		if(this.profile.role === 'Admin' ) {
			return "selected"
		} else if(this.profile.role === 'Member') {
			return "selected"
		}
	}
});
